package br.poli.ecomp.geav.nhe.model.db.pfl;import br.poli.ecomp.geav.nhe.model.db.Table;public class Profile extends Table implements IProfile{	private int pfl_identificador;	private String pfl_descricao;	public Profile(){}		@Override	public String get_pfl_descricao() {		return this.pfl_descricao;	}	@Override	public int get_pfl_identificador() {		return this.pfl_identificador;	}	@Override	public void set_pfl_descricao(String value){		this.pfl_descricao = value;	}		@Override	public void set_pfl_identificador(int value) {		this.pfl_identificador = value;	}}
